import React, { useState, useEffect } from 'react'
import addImg from '../img/addimg.png'
import './AddNew.css'
import DriveFolderUploadIcon from '@mui/icons-material/DriveFolderUpload';
import useItems from '../Context/StateContext';

function AddNew() {

    const { items, dispatch } = useItems();

    const [img, setImg]  = useState("")
    const [title, setTitle] = useState("");
    const [price, setPrice] = useState("");
    const [rating, setRating] = useState("");
    const [weight, setWeight] = useState("");
    const [quantity, setQuantity] = useState("");

    const HandleSubmit = async (e) => {
        e.preventDefault();

        const product = { title, img, rating, price, weight, quantity };
        console.log('Pre-added products are --->', product);       

        const response = await fetch('http://localhost:5000/api/items/', {
            method: 'post',
            body: JSON.stringify(product),
            headers: {
                'Content-Type': 'application/json'
            }
        })

        const json = response.json;

        if (!response.ok) {
            alert(json.error);
        }

        if(response.ok) {
            setImg('');
            setTitle('');
            setPrice('');
            setWeight('');
            setRating('');
            setQuantity('');
            alert('New Product Successfully added!!')
        }
    }

    //base64
    // const convertoBase64 = (e) => {
    //     console.log(e);
    //     var reader = new FileReader();
    //     reader.readAsDataURL(e.tagert.files[0])
    //     reader.onload = () => {
    //         console.log(reader.result)
    //         setImg(reader.result)
    //     }
    //     reader.onerror = (error) => {
    //         console.log("Error --->" , error)
    //     }
    // }

  return (
    <div className="">
        <div className="top">
              <h2>Add New Product</h2>
        </div>
        <div className="bottom">
            <div className="left">
                { img ? <img src={img}/> : <img src={addImg} />}
            </div>
            <div className="right">
                <form onSubmit={HandleSubmit}>
                    <div className="formInput">
                        <label htmlFor="file"> Image:<DriveFolderUploadIcon className="img-icon"/></label>
                        <input type="file" id="file" accept='image/' onChange={e => setImg(e.target.files[0])} style={{ display: 'none'}}/>
                    </div>
                    <div className="formInput">
                        <label>Product Name</label>
                        <input type="text" requried placeholder="Type here..." onChange={e => setTitle(e.target.value)}/>
                    </div>
                    <div className="formInput">
                        <label>Rating</label>
                        <input type="text" requried placeholder="4" onChange={e => setRating(e.target.value)}/>
                    </div>
                    <div className="formInput">
                        <label>Weight</label>
                        <input type="text" requried placeholder="3 kg" onChange={e => setWeight(e.target.value)}/>
                    </div>
                    <div className="formInput">
                        <label>Price</label>
                        <input type="text" requried placeholder="899" onChange={e => setPrice(e.target.value)}/>
                    </div>
                    <div className="formInput">
                        <label>Quantity</label>
                        <input type="text" requried placeholder="10" onChange={e => setQuantity(e.target.value)}/>
                    </div>
                    <button type="submit">Add</button>
                </form>
                {/*products.map(product => (
                    <div>
                        <p>{product.qty}</p>
                        <p>{product.name}</p>
                    </div>
                ))*/}
            </div>
        </div>
    </div>
  )
}

export default AddNew
